// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15; //^0.8.15 : 0.8.15 <=  < 0.9.0

contract Lottery {
    address public owner;
    address payable[] public players;//address payable: ETH    address 
    // winner  players    -> winner ETH  address payable 

    uint256 public lotteryId;
    mapping(uint256 => address) public lotteryHistory;

    constructor() {
        owner = msg.sender;
    }

    function getBalance() public view returns(uint256) {
        return address(this).balance;
    }

    //memory: players  storage       return   memory 
    function getPlayers() public view returns(address payable[] memory){
        return players;
    }

    //enter()   ETH    payable 
    function enter() public payable {
        require(msg.value >= .01 ether, "msg.value should be greater than equal to 0.01 ether");
        players.push(payable(msg.sender));
    }

    function getRandomNumber() public view returns(uint256) {
        //abi.encodePacked(owner, block.timestamp): owner block.timestamp  bytes converting  concat 
        return uint256(keccak256((abi.encodePacked(owner, block.timestamp))));
    }
    //block.timestamp       
    function getRandomNumberV2() public view returns(uint256) {
        return uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp, players)));
    }
    function getRandomNumberV3() public view returns(uint256) {
        return uint256(keccak256(abi.encodePacked(blockhash(block.number -1), block.timestamp)));
    }    
    /*
           PRNG        deterministic 
    ,        
    */    

    function pickWinner() public onlyOwner {
        uint256 index = getRandomNumberV3() % players.length;

        lotteryHistory[lotteryId] = players[index];
        lotteryId++;
        //       ( call)
        //re-entrancy attack ( (EOA    )   )
        (bool success, ) = players[index].call{value: address(this).balance}(""); //  (    )
        require(success, "Failed to send Ether");

        players = new address payable[](0); //   players 
    }

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }
}

